import 'bootstrap/dist/css/bootstrap.min.css'
import {useRoutes} from "routes"


const routes = useRoutes(false)
function App() {
  return (
    <BrowserRouter>
      {isAuthenticated && <Navbar />}
        <div className="container">
          {routes}
        </div>
    </BrowserRouter> 
  );
}

export default App;
